import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect
} from "react-router-dom";


function PrivateRoute({ component: Component, userConnected, ...rest }) {
    console.log(userConnected)
    return (
        <Route
            {...rest}
            render={
                (props) => userConnected === true
                    ? <Component {...props} />
                    : <Redirect to={{
                        pathname: '/login',
                    }} />
            }
        />
    )
}
export default PrivateRoute
